import React from 'react';
import Terminal, { LineType } from 'react-terminal-ui';
import './Garden.css';

function Garden({ moods }) {
  const lineData = moods.map((mood, index) => ({ type: LineType.Output, value: mood }));

  return (
    <div className="garden">
      <Terminal name="Garden" colorMode="light" lineData={lineData} />
    </div>
  );
}

export default Garden;
